import React from 'react';
import Grid from '@material-ui/core/Grid';
import Card from 'react-bootstrap/Card';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Styles from '../../Styles/ULView/';

export default class ULView extends React.Component {

    render() {
        const { data, lng, lngTranslations } = this.props;
        const Translations = lngTranslations[this.constructor.name];
        return(
            <Grid
                container
            >
                <Grid
                    item xs sm md lg
                >
                    <Card.Header style={Styles.cardHeader}>
                        {Translations[data.title]}
                    </Card.Header>
                    <Card.Body style={Styles.cardBody}>
                        <Grid
                            container
                            justify="center"
                        >
                            <List dense={true}>
                                <ListItem>
                                    <ListItemText
                                        primary="Single-line item"
                                        secondary="Secondary text"
                                    />
                                </ListItem>
                            </List>
                        </Grid>
                    </Card.Body>
                </Grid>
            </Grid>
        )
    }

}
